import { Component } from 'react';

export default class App extends Component {
  constructor(props) {
    super(props)

    this.toggleHome = this.toggleHome
  }

  render() {
  return (
    <div>
      <NavBar />
      <JamesImage />
      <JobTitle />
   </div>
  );
}
}
